	add("scabies", "{\"term\":\"scabies\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027scabiēs\u0027 (scurf; scab, mange, itch) from \u0027scabō\u0027 (scratch, scrape)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An infestation of parasitic mites, causing intense itching caused by the mites burrowing into the skin of humans and other animals. It is easily transmissible from human to human; secondary skin infection may occur\", \"priority\":1}]}, \"synonyms\":{}}");

