	add("scalp", "{\"term\":\"scalp\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"Originally a northern word, and therefore presumed to come from a Scandinavian source, although the sense-development is unclear; compare Old Norse \u0027skálpr\u0027 (sheath) Middle Dutch \u0027schelpe\u0027 (shell)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The top of the head; the skull\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The part of the head where the hair grows from, or used to grow from\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Kaitlin Newman in \u0027Baltimore Sun\u0027, \u0027[http://darkroom.baltimoresun.com/2014/11/ryan-diviney-anniversary/ Five years after beating, Ryan Diviney’s family holds out hope\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The original titanium mesh plate that was inserted in the summer of 2010 was removed last June since it was causing his \u0027\u0027scalp\u0027\u0027 to break down\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"c. \u0027\u00271590\u0027\u0027, \u0027The Two Gentlemen of Verona\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"By the bare \u0027\u0027scalpe\u0027\u0027 of Robin Hoods fat Fryer, / This fellow were a King, for our wilde faction\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A part of the skin of the head, with the hair attached, formerly cut or torn off from an enemy by Native American warriors as a token of victory\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Some tribes used to collect \u0027\u0027scalps\u0027\u0027 to prove how many of the enemy they had killed in battle\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A victory\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, John Frohnmayer, \u0027Leaving Town Alive: Confessions of an Arts Warrior\u0027 (page 331\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Pat Buchanan, in his ongoing presidential quest, claimed his first \u0027\u0027scalp\u0027\u0027, and Donald Wildmon\u0027s newsletter chortled that his efforts in opposing the NEA had paid off\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A bed or stratum of shellfish; a scaup\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The top; the summit\", \"priority\":13}]}, \"synonyms\":{}}");

