	add("scalper", "{\"term\":\"scalper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|scalp|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who scalps, or removes the scalp of another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, M. Elise Marubbio, ‎Eric L. Buffalohead, \u0027Native Americans on Film: Conversations, Teaching, and Theory\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Denouncing representations of hostile Indians as vicious \u0027\u0027scalpers\u0027\u0027 of innocent settlers\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One who scalps tickets to popular entertainment events: buying them in advance and then selling them (e.g. online or just outside the venue of the event), often at inflated price\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"We could see three different \u0027\u0027scalpers\u0027\u0027 moving through the crowd outside the arena, each muttering the characteristic refrain: “Need any tickets?”\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A person on an open outcry exchange trading floor who buys and sells rapidly for his or her own account, aiming to buy from a seller and a little later sell to a buyer, making a small profit from the difference (roughly the amount of the bid/offer spread, or less\", \"priority\":6}]}, \"synonyms\":{}}");

