	add("scandal", "{\"term\":\"scandal\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle french (ca. 1400-1600)\", \"old high german (ca. 750-1050)\", \"gothic\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027scandale\u0027 (indignation caused by misconduct or defamatory speech) from \u0027scandalum\u0027 (that on which one trips, cause of offense) from Ancient greek (to 1453) \u0027σκάνδαλον|lang\u003dgrc\u0027 () from Proto-indo-european {{m|ine-pro|*skand-||to jump}}. Cognate with Latin \u0027scandō\u0027 (to climb) First attested from \u0027escandle\u0027 but the modern word is a reborrowing. Sense evolution from \u0026quot;cause of stumbling, that which causes one to sin, stumbling block\u0026quot; to \u0026quot;discredit to reputation, that which brings shame, thing of disgrace\u0026quot; possibly due to early influence from other similar :sounding words for \u0027infamy\u0027 and \u0027disgrace\u0027 (compare Old english (ca. 450-1100) \u0027scand\u0027 (ignominity, scandal, disgraceful thing) Old high german (ca. 750-1050) \u0027scanda\u0027 (ignominy, disgrace) Gothic \u0027𐍃𐌺𐌰𐌽𐌳𐌰\u0027 (tr\u003dskanda) . See {{l|en|shand}}, {{l|en|shend}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An incident or event that disgraces or damages the reputation of the persons or organization involved\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"O, what a \u0027\u0027scandal\u0027\u0027 is it to our crown, / That two such noble peers as ye should jar\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003dInternal chapter\u003d1|url\u003dhttp://openlibrary.org/works/OL4103950W|passage\u003dBut electric vehicles and the batteries that made them run became ensnared in corporate \u0027\u0027scandals\u0027\u0027, fraud, and monopolistic corruption that shook the confidence of the nation and inspired automotive upstarts\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d3|page\u003d21|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/joris-luyendijk-banking-blog/2013/jun/19/banking-britain-beyond-control Our banks are out of passage\u003dSeeing the British establishment struggle with the financial sector is like watching an alcoholic. Until 2008 there was denial over what finance had become.But the \u0027\u0027scandals\u0027\u0027 kept coming, and so we entered stage three\u0026amp;mdash;what therapists call \u0026quot;bargaining\u0026quot;. A broad section of the political class now recognises the need for change but remains unable to see the necessity of a fundamental overhaul. Instead it offers fixes and patches\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Damage to one\u0027s reputation\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Such a scandal as the \u0027\u0027prosecution\u0027\u0027 of a brother for forgery—with a verdict of guilty—is a most truly horrible, deplorable, fatal thing. It takes the respectability out of a family perhaps at a critical moment, when the family is just assuming the robes of respectability\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Widespread moral outrage, indignation, as over an offence to decency\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Religious discredit; an act or behaviour which brings a religion into discredit\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Something which hinders acceptance of religious ideas or behaviour; a stumbling-block or offense\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Defamatory talk; gossip, slander\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1855\u0027\u0027, Anthony Trollope, \u0027The Warden\u0027, s:The Warden/Chapter chapter\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Scandal\u0027\u0027 at Barchester affirmed that had it not been for the beauty of his daughter, Mr. Harding would have remained a minor canon; but here probably \u0027\u0027Scandal\u0027\u0027 lied, as she so often does; for even as a minor canon no one had been more popular among his reverend brethren in the close, than Mr. Harding; and \u0027\u0027Scandal\u0027\u0027, before she had reprobated Mr. Harding for being made precentor by his friend the bishop, had loudly blamed the bishop for having so long omitted to do something for his friend Mr. Harding\", \"priority\":13}]}, \"synonyms\":{}}");

