	add("scanner", "{\"term\":\"scanner\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|scan}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device which scans documents in order to convert them to a digital medium\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He put the picture in the \u0027\u0027scanner\u0027\u0027, then e-mailed a copy of it to his family\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A radio receiver which iterates through a sequence of frequencies to detect signal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A device which uses radiation (ultrasound, X-ray, etc.) to generate images of tissue or surfaces for diagnostic purposes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A device which uses optics to detect printed data (such as a barcode\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One who scans\", \"priority\":6}]}, \"synonyms\":{}}");

