	add("scantling", "{\"term\":\"scantling\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Alteration of \u0027\u0027 by association with \u0027\u0027 from Old french (842-ca. 1400) \u0027escantillon\u0027 (sample pattern) (Modern French \u0027échantillon\u0027 . Later senses also influenced by similarity with \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The set size or dimension of a piece of timber, stone etc., or materials used to build ships or aircraft\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A small portion, a scant amount\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Folio Society, 2006, vol.1, p.204\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"For one may have particular knowledge of the nature of one river, and experience of the qualitie of one fountaine, that in other things knowes no more than another man: who neverthelesse to publish this little \u0027\u0027scantling\u0027\u0027, will undertake to write all of the Physickes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Such as exceed not this \u0027\u0027scantling\u0027\u0027, to be solace to the sovereign and harmless to the people\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A pretty \u0027\u0027scantling\u0027\u0027 of his knowledge may taken by his deferring to be baptized so many years\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Jeremy Taylo\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Reducing them to narrow \u0027\u0027scantlings\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A small, upright timber used in construction, especially less than five inches square\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A rough draught; a crude sketch or outline\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A frame for casks to lie upon; a trestle\", \"priority\":13}]}, \"synonyms\":{}}");

	add("scants", "{\"term\":\"scants\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of underwear worn by men\", \"priority\":1}]}, \"synonyms\":{}}");

	add("scapegoat", "{\"term\":\"scapegoat\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hebrew\"], \"text\":\"Coined by w:William Tyndale|Tyndale from {{compound|scape|goat|lang\u003den}}, interpreting Hebrew \u0027עזאזל|sc\u003dhebr\u0027 (azazel) (Leviticus 16:8, 10, 26), from an interpretation as coming from \u0027sc\u003dhebr|עז|tr\u003dez\u0027 (goat) and \u0027sc\u003dhebr|אוזל|tr\u003dozél\u0027 (escapes) First attested 1530.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In the Mosaic Day of Atonement ritual, a goat symbolically imbued with the sins of the people, and sent out alive into the wilderness while another was sacrificed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1646\u0027\u0027, Sir Thomas Browne, \u0027Pseudodoxia Epidemica\u0027, Book II, ch\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"alluding herein unto the heart of man and the precious bloud of our Saviour, who was typified by the Goat that was slain, and the \u0027\u0027scape-Goat\u0027\u0027 in the Wildernes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Someone punished for the error or errors of someone else\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He is making me a \u0027\u0027scapegoat\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1834\u0027\u0027, Thomas Babington Macaulay, \u0026quot;William Pitt, Earl of Chatham\u0026quot; [http://www.gutenberg.org/etext/2332\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The new Secretary of State had been long sick of the perfidy and levity of the First Lord of the Treasury, and began to fear that he might be made a \u0027\u0027scapegoat\u0027\u0027 to save the old intriguer who, imbecile as he seemed, never wanted dexterity where danger was to be avoided\", \"priority\":7}]}, \"synonyms\":{}}");

