	add("scapular", "{\"term\":\"scapular\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027scapulāre\u0027 from Latin \u0027scapula\u0027 (shoulder) Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short cloak worn around the shoulders, adopted as part of the uniform of various religious orders, later often with an embroidered image of a saint\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, \u0027Religion and the Decline of Magic\u0027, Folio Society 2012, p. 30\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027scapular\u0027\u0027, or friar\u0027s coat, for example, was a coveted object to be worn as a preservative against pestilence or the ague […\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 409\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She granted the Whitefriars identical powers to the Blackfriars, to bless a part of their friar\u0027s habit which draped over their shoulders and was known as the \u0027\u0027scapular\u0027\u0027; now laity could wear it and derive spiritual privileges from it\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One of a special group of feathers which arise from each of the scapular regions and lie along the sides of the back\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A bandage passing over the shoulder to support it, or to retain another bandage in place\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A devotional object, typically consisting of two rectangular pieces of cloth (often with an embroidered image or text) joined with cloth bands and worn with one piece over the chest and one in the back\", \"priority\":8}]}, \"synonyms\":{}}");

	add("scarceness", "{\"term\":\"scarceness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|scarce|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of being scarce\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Collie\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The value of an advantage is enhanced by its \u0027\u0027scarceness\", \"priority\":3}]}, \"synonyms\":{}}");

	add("scarecrow", "{\"term\":\"scarecrow\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|scare|crow|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An effigy, typically made of straw and dressed in old clothes, fixed to a pole in a field to deter birds from eating seeds or crops planted there\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A tall, thin, awkward person\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Anything that appears terrifying but offers no danger\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027scarecrow\u0027\u0027 set to frighten fools away.\u0027 \u0026amp;mdash; Dryden\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person clad in rags and tatters\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"No eye hath seen such \u0027\u0027scarecrows\u0027\u0027. I\u0027ll not march with them through Coventry, that\u0027s flat.\u0027 \u0026amp;mdash; Shakespeare\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A bird, the black tern\", \"priority\":7}]}, \"synonyms\":{}}");

