	add("scarer", "{\"term\":\"scarer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|scare|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, scares\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1894\u0027\u0027, William Crooke, \u0027An Introduction to the Popular Religion and Folklore of Northern India\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The letter from a Raja is spotted with gold-leaf as a preservative, partly to divert the glance of fascination and partly because gold is a \u0027\u0027scarer\u0027\u0027 of demons\", \"priority\":3}]}, \"synonyms\":{}}");

	add("scareware", "{\"term\":\"scareware\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|scare|ware|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Software that attempts to scare the user into compliance, as by displaying false warnings of virus infection\", \"priority\":1}]}, \"synonyms\":{}}");

