	add("scavenger", "{\"term\":\"scavenger\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027scavager\u0027 from Anglo-norman \u0027scawageour\u0027 (one who had to do with scavage, inspector, tax collector) from {{m|fro|*scawage}}, \u0027escauwage\u0027 (scavage) Old french (842-ca. 1400) {{m|fro|*scavage}}, \u0027escavage\u0027 alteration of \u0027escauvinghe\u0027 (compare also \u0027scewinga\u0027 \u0027sceawinga\u0027 , from Middle english (1100-1500) \u0027schewing\u0027 (inspection, examination) from Old english (ca. 450-1100) {{m|ang|scēawung||reconnoitering, surveying, inspection, examination, scrutiny}}, equivalent to \u0027showing\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A street sweeper\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone who scavenges, especially one who searches through rubbish for food or useful things\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An animal that feeds on decaying matter such as carrion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A substance used to remove impurities from the air or from a solution\", \"priority\":4}]}, \"synonyms\":{}}");

